import { UPDATE_ORDER_NUMBER } from '../Actions/types';

const initialState = {};

export const userOrder = (state = initialState, { type, payload }) => {
  switch (type) {
    case UPDATE_ORDER_NUMBER:
      return { ...state, ...payload };

    default:
      return state;
  }
};
